import axios from "axios";

let initialState = {
	count: 0,
	Products: []
};

axios.get("https://demo8421975.mockable.io/products").then(res => {
	initialState.Products.push(res.data.products)
})

const reducer = (state = initialState, action)=>
{
	return state;
}

export default reducer;
